import configparser
import datetime
import os
import typing
from datetime import datetime as Datetime
from datetime import timezone
from math import isclose
from test.integration.datatype._generate_test_datatype_tables import (  # type: ignore
    DATATYPES_WITH_MS,
    FLOAT_DATATYPES,
    Datatypes,
    RedshiftDatatypes,
    datatype_test_setup,
    datatype_test_teardown,
    get_table_name,
    redshift_test_data,
    test_data,
)

import pytest  # type: ignore

import redshift_connector
from redshift_connector.config import ClientProtocolVersion
from redshift_connector.interval import IntervalDayToSecond, IntervalYearToMonth

conf = configparser.ConfigParser()
root_path = os.path.dirname(os.path.dirname(os.path.abspath(os.path.join(__file__, os.pardir))))
conf.read(root_path + "/config.ini")


@pytest.fixture(scope="session", autouse=True)
def create_datatype_test_resources(request):
    """
    Creates datatype test schema, tables, and inserts test data.
    """
    datatype_test_setup(conf)

    def fin():
        datatype_test_teardown(conf)

    request.addfinalizer(fin)


@pytest.mark.skip(reason="manual")
@pytest.mark.parametrize("datatype", Datatypes.list())
@pytest.mark.parametrize("client_protocol", ClientProtocolVersion.list())
def test_datatype_recv_support(db_kwargs, datatype, client_protocol) -> None:
    db_kwargs["client_protocol_version"] = client_protocol
    table_name: str = get_table_name(datatype)
    exp_results: typing.Tuple[typing.Tuple[typing.Any, ...], ...] = test_data[datatype.name]

    with redshift_connector.connect(**db_kwargs) as con:
        assert con._client_protocol_version == client_protocol
        with con.cursor() as cursor:
            cursor.execute("select * from {}".format(table_name))
            results = cursor.fetchall()

            assert results is not None
            assert len(results) == len(exp_results)

            for ridx, exp_row in enumerate(exp_results):
                assert results[ridx][0] == exp_row[0]

                # the expected Python value is stored in the last index of the tuple
                if datatype in FLOAT_DATATYPES:
                    assert isclose(
                        typing.cast(float, results[ridx][1]),
                        typing.cast(float, exp_row[-1]),
                        rel_tol=1e-05,
                        abs_tol=1e-08,
                    )

                elif datatype in DATATYPES_WITH_MS:
                    assert results[ridx][1].replace(microsecond=0) == exp_row[-1].replace(microsecond=0)
                    assert isclose(results[ridx][1].microsecond, exp_row[-1].microsecond, rel_tol=1e1)
                else:
                    assert results[ridx][1] == exp_row[-1]


redshift_datatype_testcases: typing.List[typing.Tuple] = []
for datatype in redshift_test_data:
    for test_case in redshift_test_data[datatype]:
        redshift_datatype_testcases.append((datatype, test_case))


@pytest.mark.parametrize("client_protocol", ClientProtocolVersion.list())
@pytest.mark.parametrize("_input", redshift_datatype_testcases)
def test_redshift_specific_recv_support(db_kwargs, _input, client_protocol) -> None:
    db_kwargs["client_protocol_version"] = client_protocol
    datatype, data = _input
    test_val, exp_val = data[:2]

    with redshift_connector.connect(**db_kwargs) as con:
        with con.cursor() as cursor:
            if datatype in ["intervaly2m", "intervald2s"]:
                test_val = "'{}'::{}".format(test_val, datatype)
            cursor.execute("select {}".format(test_val))
            results: typing.Tuple = cursor.fetchall()
            assert len(results) == 1
            assert len(results[0]) == 1
            if datatype in ("varbyte", "geography"):
                assert results[0][0].lower() == exp_val.lower()
            else:
                assert results[0][0] == exp_val


@pytest.mark.parametrize("client_protocol", ClientProtocolVersion.list())
@pytest.mark.parametrize("_input", redshift_test_data[RedshiftDatatypes.varbyte.name])
def test_redshift_varbyte_insert(db_kwargs, _input, client_protocol) -> None:
    db_kwargs["client_protocol_version"] = client_protocol
    datatype, data = _input

    with redshift_connector.connect(**db_kwargs) as con:
        with con.cursor() as cursor:
            cursor.execute("create table t_varbyte (id int, v1 varbyte)")
            cursor.execute("insert into t_varbyte(v1) values(%s)", (bytes(data, encoding="utf-8"),))
            cursor.execute("select id, v1 from t_varbyte")
            results: typing.Tuple = cursor.fetchall()
            assert len(results) == 1
            assert len(results[0]) == 2
            assert results[0][1] == bytes(data, encoding="utf-8").hex()


@pytest.mark.parametrize("client_protocol", ClientProtocolVersion.list())
@pytest.mark.parametrize("datatype", [RedshiftDatatypes.intervaly2m.name, RedshiftDatatypes.intervald2s.name])
def test_redshift_interval_insert(db_kwargs, datatype, client_protocol) -> None:
    db_kwargs["client_protocol_version"] = client_protocol
    data = redshift_test_data[datatype]
    redshift_type = IntervalYearToMonth if (datatype == "intervaly2m") else IntervalDayToSecond

    with redshift_connector.connect(**db_kwargs) as con:
        with con.cursor() as cursor:
            cursor.execute("create table t_interval(id text, v1 {})".format(datatype))
            for row in data:
                cursor.execute("insert into t_interval values ('{}', '{}')".format(row[-1], row[0]))
            cursor.execute("select id, v1 from t_interval")
            results: typing.Tuple = cursor.fetchall()
            assert len(results) == len(data)
            print(results)
            for idx, result in enumerate(results):
                print(result[1], data[idx][1])
                assert isinstance(result[1], redshift_type)
                assert result[1] == data[idx][1]
            cursor.execute("drop table t_interval")


@pytest.mark.parametrize("client_protocol", ClientProtocolVersion.list())
@pytest.mark.parametrize("datatype", [RedshiftDatatypes.intervaly2m.name, RedshiftDatatypes.intervald2s.name])
def test_redshift_interval_prep_stmt(db_kwargs, datatype, client_protocol) -> None:
    db_kwargs["client_protocol_version"] = client_protocol
    data = redshift_test_data[datatype]
    redshift_type = IntervalYearToMonth if (datatype == "intervaly2m") else IntervalDayToSecond

    with redshift_connector.connect(**db_kwargs) as con:
        with con.cursor() as cursor:
            cursor.execute("create table t_interval_ps(id text, v1 {})".format(datatype))
            cursor.paramstyle = "pyformat"
            cursor.executemany(
                "insert into t_interval_ps(id, v1) values (%(id_val)s, %(v1_val)s)",
                ({"id_val": row[-1], "v1_val": row[1]} for row in data[:2]),
            )
            cursor.paramstyle = "qmark"
            cursor.executemany("insert into t_interval_ps values (?, ?)", ([row[-1], row[1]] for row in data[2:]))
            cursor.execute("select id, v1 from t_interval_ps")
            results: typing.Tuple = cursor.fetchall()
            assert len(results) == len(data)
            print(results)
            for idx, result in enumerate(results):
                print(result[1], data[idx][1])
                assert isinstance(result[1], redshift_type)
                assert result[1] == data[idx][1]
            cursor.execute("drop table t_interval_ps")


